  false,\n\t\"url\": null,\n\t\"notes\": \"ESI data characterize coastal environments
  and wildlife by their sensitivity to spilled oil. The ESI data include information
  for three main components: shoreline habitats; sensitive biological resources; and
  human-use resources. These data are from a single DVD product that is a re-release
  of Florida ESI data originally published between 1998 and 2004 as separate CDs in
  portable document format (PDF). The original PDFs been modified here to include
  the back of the map or seasonality pages as part of each individual map document.
  This should make it easier to distribute and print maps and ensure that the supporting
  information is always included. A master index for navigating through the PDF maps
  is provided. Also included on the DVD is the state-wide Florida ESI data in a geodatabase
  format (Arc GIS v9.x or compatible). Data for the St. John's River region is included.nnThe
  content of these data has not been updated or modified from that published in the
  original ESI atlases. The original products were archived at NODC under the following
  accesion numbers: East Florida 0004150, West Florida 0006249, South Florida 0006539,
  West Peninsular Florida Part One 0006377, West Peninsular Florida Part Two 0006394.
  Source data dates range from 1964 to 1996, and source data is described in the metadata
  included in the original data sets.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
